import Link from "next/link";

let arr = [1, 2, 3];
 const List = () => {
  return (
    <div>
      <h2>List列表页</h2>
      <hr />
      <Link href='./list/[id]' as='./list/12312'>
        <a>新闻</a>
      </Link>
      {arr.map(item => {
        <Link href="./list/[id]" as={`./list/${item}`} key={item}>
          <a>新闻{item}</a>
        </Link>
      })}
    </div>
  );
};

export default List;
